import React from "react";

export default function WeatherTemperature(props) {
  return (
    <div className="WeatherTemperature temp d-inline" id="bigTemp">
      {Math.round(props.celsius)}
      <a href="/" id="celsius">
        °C |
      </a>
      <a href="/" id="fahrenheit">
        °F
      </a>
    </div>
  );
}
